import React, { useEffect } from "react";
import useInput from "../hooks/useInput";

import "./WritePost.css";

const sendPostForm = () => {};

const WritePost = () => {
  const [postTitle, onChangePostTitle] = useInput("");
  const [postContent, onChangeContent] = useInput("");

  useEffect(() => {
    console.log(postTitle);
  }, [postTitle]);

  return (
    <form action="GET" className="writePostForm">
      <input
        type="text"
        name="postTitle"
        className="postArticle postTitle"
        placeholder="제목"
        value={postTitle}
        onChange={onChangePostTitle}
      />
      <textarea
        type="textarea"
        name="postContent"
        className="postArticle postContent"
        placeholder="내용"
        value={postContent}
        onChange={onChangeContent}
      />
      <button className="postArticle sendPostForm" onClick={sendPostForm}>
        완료
      </button>
    </form>
  );
};

export default WritePost;
